const userProjects=$(".userInfoProjects"),instanceProjects=$("#instanceDataProjects"),userH1=$("#userH1");userProjects.on("click",function(a){a.preventDefault(),instanceProjects.empty();const b=$(this).data("id"),c=a=>{for(let b=0;b<a.length;b++){const c=a[b],d=c.timeIn,e=c.timeOut,f=moment(d.split(" ").join("T")),g=moment(e.split(" ").join("T")),h=g.diff(f,"hours",!0);c.timeSpent=h}};$.get("/api/chartingInstances/all/"+b).then(a=>{c(a);for(let b=0;b<a.length;b++)instanceProjects.append(`<tr id="${a[b].id}">
        <td>${a[b].projectName}</td>
        <td>${a[b].timeIn}</td>
        <td>${a[b].timeOut}</td>
        <td>${a[b].timeSpent.toFixed(2)}</td>
        </tr>`)}),$.get("/api/user/"+b).then(a=>{console.log(a),userH1.text(`${a.firstName} ${a.lastName}`)})});